	public static int lengthOfLongestSubstring(String s) {
		if (s.isEmpty()) {
			return 0;
		}
		if (s.length() == 1) {
			return 1;
		}
		int result = 0;
		String analyer = analysisAllChractar(s);
		for (int i = 0; i < analyer.length(); i ++) {
			String tmp = s.substring(i, i+1);
			int start = 0;
			int end = 0;
			start = s.indexOf(tmp, start);
			while (start <= s.length() - 1) {
				if (start == s.indexOf(tmp, start)) {
					end = s.indexOf(tmp, start + 1);
				} else {
					//do something to end
					int tm = s.indexOf(tmp, start + 1);
					end = s.indexOf(tmp, tm + 1);
				}
				if (end == -1) break; 
				if (end - start > analyer.length()) {
					continue;
				} else {
					if (!containDuplicate(s.substring(start, end), analyer)) {
						if (result < end - start) {
							result = end - start;
						}
					} else {
						continue;
					}
				}
				start++;
			}
			
		}
		return result;
        
    }
	
	public static String analysisAllChractar(String s) {
		List<Integer> index = new ArrayList<>();
		String result = s.substring(0, 1);
		index.add(s.indexOf(result));
		for (int i = 0; i < s.length(); i ++) {
			String tmp = s.substring(i, i+1);
			int idx = s.indexOf(tmp);
			if (index.contains(idx)) {
				continue;
			} else {
				index.add(idx);
				result += tmp;
			}
		}
		return result;
	}
	
	public static boolean containDuplicate(String str1, String str2) {
		for (int i = 0; i < str2.length(); i++) {
			String tmp = str2.substring(i, i+1);
			if (str1.indexOf(tmp) == str1.lastIndexOf(tmp)) {
				continue;
			} else {
				return true;
			}
		}
		return false;
	}
	
	public static int lengthOfLongestSubstring2(String s) {
		int result = 0;
		int increatNum = 1;
		for (int i = 0; i < s.length();) {
			while (i + increatNum + 1 <= s.length()) {
//				String str1 = s.substring(i, i + increatNum);
				int dup = s.indexOf(s.charAt(i + increatNum), i);
				if (dup == -1 || dup >= i + increatNum) {
					increatNum++;
				} else {
					break;
				}
			}
			if (result < increatNum) {
				result = increatNum;
			}
			if (i+increatNum < s.length()) {
				i = s.indexOf(s.charAt(i+increatNum), i) + 1;
				increatNum = increatNum - i;
				increatNum = increatNum <= 0 ? 1 : increatNum;
			} else {
				break;
			}
			
		}
		return result;
		
	}
    
